import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Blockchain Data
        </p>

        <input type='text' name='value' id='value' /><br />
        <button>Fetch</button>
        <button>Set</button>
      </header>
    </div>
  );
}

export default App;
